def main(input):
    player = input['player']
    character_name = input['character_name']
    character_pos = int(input['character_pos'])

    characters = player.get('characters', [])

    # Find all indices where the character name matches
    matches = [i for i, c in enumerate(characters) if c['name'] == character_name]

    if not matches:
        return {'error': f"No character found with name '{character_name}'", 'player': player}

    # If only one match, remove it directly
    if len(matches) == 1:
        target_index = matches[0]
    else:
        # If multiple matches, use the provided position
        if character_pos < 1 or character_pos > len(matches):
            return {'error': f"Invalid character_pos {character_pos} for name '{character_name}'", 'player': player}
        target_index = matches[character_pos - 1]

    removed_character = characters.pop(target_index)
    player['characters'] = characters

    return {
        'player': player,
        'removed_character': removed_character
    }

def main(input):
    # Extract inputs
    char_id = input.get('char_id', '')
    player_data = input.get('player', {})
    new_position = input.get('travel', '0,0')  # e.g., '0,2'

    characters = player_data.get('characters', [])

    for character in characters:
        if character.get('char_id') == char_id:
            current_map = character.get('current_map', {})

            # Update player position
            current_map['player_position'] = new_position
            character['current_map'] = current_map

            # Return updated player object
            return {'player': player_data}

    # Fallback (character not found)
    return {
        'error': f"Character '{char_id}' not found.",
        'player': player_data
    }

import copy

def main(input):
    '''
    Shop sell handler (updated):
    - Takes in player, character_name, and sale_id (item_id from inventory or equipped gear).
    - Finds the matching item from inventory or equipment.
    - Removes it from the player's inventory/equipment.
    - Adds its gold value to the player's gold.
    - If shop has < 3 items, adds the sold item to shop_items.
    - If shop has 3 or more items, the sold item is destroyed.
    - Returns full updated player object.
    '''

    # === Get inputs ===
    player = copy.deepcopy(input.get('player', {}))
    character_name = input.get('character_name')
    sale_id = input.get('sale_id')

    # === Locate character ===
    character = next((c for c in player.get('characters', []) if c.get('name') == character_name), None)
    if not character:
        return {'error': f"Character '{character_name}' not found."}

    # === Helper to find item in inventory or equipment ===
    def find_item(lists):
        for list_name, lst in lists.items():
            for idx, i in enumerate(lst):
                if i.get('item_id') == sale_id:
                    return list_name, idx, i
        return None, None, None

    lists_to_search = {
        'inventory': character.get('inventory', []),
        'equipment': character.get('equipment', [])
    }

    lst_name, idx, item = find_item(lists_to_search)
    if not item:
        return {'error': f"Item '{sale_id}' not found in inventory or equipment."}

    # === Handle gold transfer ===
    item_value = item.get('value', 0)
    character['gold'] = character.get('gold', 0) + item_value

    # === Remove item from list ===
    if lst_name == 'inventory' and item.get('type') == 'consumable' and item.get('qty', 0) > 1:
        item['qty'] -= 1
    else:
        del character[lst_name][idx]

    # === Manage shop capacity ===
    shop_items = character.get('shop_items', [])
    if len(shop_items) < 3:
        new_item = copy.deepcopy(item)
        if new_item.get('type') == 'consumable':
            new_item['qty'] = 1
        shop_items.append(new_item)
        character['shop_items'] = shop_items
    else:
        # Shop is full – item destroyed
        pass

    # === Update character back into player ===
    for i, c in enumerate(player.get('characters', [])):
        if c.get('name') == character_name:
            player['characters'][i] = character
            break

    return {'player': player}

def main(input):
    player = input.get('player', {})
    character_id = input.get('character_id')

    characters = player.get('characters', [])

    # Find the character to remove
    removed_character = next(
        (c for c in characters if str(c.get('char_id')) == str(character_id)),
        None
    )

    if not removed_character:
        return {'error': f"No character found with id '{character_id}'", 'player': player}

    # Remove the character
    player['characters'] = [c for c in characters if str(c.get('char_id')) != str(character_id)]

    return {
        'success': True,
        'player': player,
        'removed_character': removed_character
    }

def main(input):
    action = input.get('action')  # 'heal' or 'antidote'
    player = input.get('player', {})
    char_id = input.get('char_id')

    if not action or not player or not char_id:
        return {'error': 'Missing required input (action, player, char_id)'}

    # Locate active character
    active_char = next((c for c in player.get('characters', []) if c.get('char_id') == char_id), None)
    if not active_char:
        return {'error': f"Character with id '{char_id}' not found"}

    inventory = active_char.get('inventory', [])

    # Helper to find inventory item
    def get_item(item_id):
        return next((i for i in inventory if i.get('item_id') == item_id), None)

    # Process Heal Action
    if action == 'heal':
        potion = get_item('potion')
        if not potion or potion.get('qty', 0) <= 0:
            return player  # no potion available

        heal_amount = int(active_char['max_hp'] * 0.25)
        active_char['hp'] = min(active_char['hp'] + heal_amount, active_char['max_hp'])

        # deduct potion
        potion['qty'] = max(0, potion.get('qty', 0) - 1)

    # Process Antidote Action
    elif action == 'antidote':
        antidote = get_item('antidote')
        if not antidote or antidote.get('qty', 0) <= 0:
            return player  # no antidote available

        # clear status
        active_char['status'] = ''

        # deduct antidote
        antidote['qty'] = max(0, antidote.get('qty', 0) - 1)

    else:
        return {'error': f"Unsupported action '{action}'"}

    return player

